window.bookSummaryJSON = "<p><i>Harrow the Ninth</i>, the sequel to the sensational, <i>USA Today</i> best-selling novel <i>Gideon the Ninth</i>, turns a galaxy inside out as one necromancer struggles to survive the wreckage of herself aboard the emperor's haunted space station.&nbsp;&nbsp;</p> <p>She answered the emperor's call.&nbsp;&nbsp;</p> <p>She arrived with her arts, her wits, and her only friend.&nbsp;&nbsp;</p> <p>In victory, her world has turned to ash.&nbsp;&nbsp;</p> <p>After rocking the cosmos with her deathly debut, Tamsyn Muir continues the story of the penumbral Ninth House in <i>Harrow the Ninth</i>, a mind-twisting puzzle box of mystery, murder, magic, and mayhem. Nothing is as it seems in the halls of the emperor, and the fate of the galaxy rests on one woman's shoulders.&nbsp;&nbsp;</p> <p>Harrowhark Nonagesimus, last necromancer of the Ninth House, has been drafted by her emperor to fight an unwinnable war. Side-by-side with a detested rival, Harrow must perfect her skills and become an angel of undeath - but her health is failing, her sword makes her nauseous, and even her mind is threatening to betray her.&nbsp;&nbsp;</p> <p>Sealed in the Gothic gloom of the emperor's Mithraeum with three unfriendly teachers, hunted by the mad ghost of a murdered planet, Harrow must confront two unwelcome questions: Is somebody trying to kill her? And if they succeeded, would the universe be better off?</p>"; 
